def Now_Loop(url,iconimage,fanart):
    HTML = process.OPEN_URL(url)
    match = re.compile('<a href="(.+?)">(.+?)</a>').findall(HTML)
    for url2,name in match:
        Next_url = url + url2
        if 'CD' in Next_url:
            process.Menu((name).replace('/','').replace('&nbsp;','-').replace('---',' - ').replace('&#039;','\'').replace('&amp;','&').replace('&quot;','"'),Next_url,1702,iconimage,fanart,'','')
        elif 'SIDE' in Next_url:
            process.Menu((name).replace('/','').replace('&nbsp;','-').replace('---',' - ').replace('&#039;','\'').replace('&amp;','&').replace('&quot;','"'),Next_url,1702,iconimage,fanart,'','')
			
def Now_Playlinks(url,iconimage,fanart):
    HTML = process.OPEN_URL(url)
    match = re.compile('<a href="(.+?)">(.+?)</a>').findall(HTML)
    for url2,name in match:
        if 'mp3' in url2:
            Playlink = url+url2
            process.Play((name).replace('.mp3','').replace('&nbsp;','-').replace('---',' - ').replace('&#039;','\'').replace('&amp;','&').replace('&quot;','"'),Playlink,105,iconimage,fanart,'','')